INSERT INTO `xh_goods` VALUES ('34c6af36e2694f65855add445c2fe781', '1', '2019-05-15 12:03:44', '1', '2019-06-12 08:45:24', NULL, '0', '368d426edf6a42308e724d6065fdaf5f', '康乃馨', 'KNX', '热情、魅力', '1', '1', '29.9', '39.9', '0', '<h1 style=\"margin: 0px; padding: 0px; font-size: 12px; font-weight: 500; font-family: arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><strong><span style=\"font-size: 18px;\"><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51);\">康乃</span><span style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51);\">馨</span></span></strong><span style=\"font-size: 16px;\"><span class=\"title\" style=\"font-family: \"> - <span style=\"font-size: 14px;\">石竹属植物</span></span> </span></h1><p><span style=\"font-size: 16px;\">    <span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">康乃馨 ，学名香石竹，又名狮头石竹、大花石竹、荷兰石竹，为石竹科石竹属的植物，多年生草本，丛生，无毛全体乳绿色。茎直立，高30-60厘米，上部稀疏分枝。叶长条形，乳绿色，5脉，中脉特显，先端长渐尖，基部成短鞘围抱节上。花单生，或成聚伞花序，颜色鲜艳且富有芳香，有蔷薇色、紫色、白色各种花；萼下有小苞片4枚，菱状卵形，先端短尖，长约为萼简之1/4；萼简先端5裂，齿三角形，边缘膜质；花瓣5，倒卵形，先端锯齿状浅裂，基部有须毛。蒴果长卵形。 原产欧洲南部一带，国内广泛栽培，为常见的观赏植物。1907年起，开始以粉红色康乃馨作为</span><a target=\"_blank\" href=\"https://baike.so.com/doc/5333005-5568373.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">母亲节</a><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">的象征，故今常被作为献给</span><a target=\"_blank\" href=\"https://baike.so.com/doc/5353607-5629620.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">母亲</a><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">的花。 纯天然康乃馨产于</span><a target=\"_blank\" href=\"https://baike.so.com/doc/2546461-2689691.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none; font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; white-space: normal; background-color: rgb(255, 255, 255);\">云南</a><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">高寒地区，海拔3000米以上，无任何杂质感染，具有健脾补肺、固肾益精，治虚劳、咳嗽、消渴等功用。是馈赠亲友的好补品。</span></span></p><p><img src=\"http://127.0.0.1:8080/../ueditor/jsp/upload/image/20190612/1560300316647049629.png\" title=\"1560300316647049629.png\" alt=\"jfgl.png\"/></p><p><span style=\"font-size: 16px;\"><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\"><br/></span></span></p><p><span style=\"font-size: 18px;\"><strong><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; text-indent: 28px; background-color: rgb(255, 255, 255);\">形态特征</span></strong></span></p><p><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">       </span><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">常绿亚灌木，作多年生</span><a target=\"_blank\" href=\"https://baike.so.com/doc/5107446-5336107.html\" style=\"font-family: arial, sans-serif; font-size: 14px; text-indent: 2em; margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">宿根花卉</a><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">栽培。因</span><a target=\"_blank\" href=\"https://baike.so.com/doc/3945343-4140334.html\" style=\"font-family: arial, sans-serif; font-size: 14px; text-indent: 2em; margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">花瓣</a><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">具繸缘及香郁气味，而广受栽培（现代香石竹已少有香气）。一般分为家养康乃馨与花店康乃馨两类；茎丛生，质坚硬，灰绿色，节膨大，高度约50㎝。叶厚线形，对生。茎叶与中国石竹相似而较粗壮，被有白粉。花大，具芳香，单生、2－3朵簇生或成聚伞花序；萼下有菱状卵形小苞片四枚，先端短尖，长约萼筒四分之一；萼筒绿色，五裂；花瓣不规则</span><a class=\"reference_sup\" href=\"https://baike.so.com/doc/2744595-2896696.html#refff_2744595-2896696-5\" style=\"font-family: arial, sans-serif; text-indent: 2em; margin: 0px 0px 0px 2px; padding: 0px 2px; color: rgb(51, 102, 204); text-decoration-line: none; cursor: pointer; font-size: 12px; position: relative; top: -0.5em; vertical-align: baseline; white-space: nowrap;\">[5]</a><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">，边缘有齿，单瓣或重瓣，有红色、</span><a target=\"_blank\" href=\"https://baike.so.com/doc/588078-622529.html\" style=\"font-family: arial, sans-serif; font-size: 14px; text-indent: 2em; margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">粉色</a><span style=\"background-color: rgb(255, 255, 255); color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; text-indent: 2em;\">、黄色、白色等色。</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">花期4月至9月，保护地栽培四季开花。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">康乃馨作为花卉名称，是英文Carnation一词的音译词，它是一种大量种植的石竹科、石竹属多年生植物，是玫瑰的一种。通常开重瓣花，花色多样且鲜艳，气味芳香。康乃馨是最受欢迎的切花之一，代表了健康和美好。可供作插花、胸花等。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">1907年，美国费城的贾维斯(Jarvis)曾以粉红色康乃馨作为<a target=\"_blank\" href=\"https://baike.so.com/doc/5333005-5568373.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">母亲节</a>的象征。而在<a target=\"_blank\" href=\"https://baike.so.com/doc/3840102-4032232.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">欧洲</a>，康乃馨曾被用来治疗发烧，在伊利莎白时代亦曾被用为葡萄酒与麦酒的香料添加剂，以代替价钱较贵的<a target=\"_blank\" href=\"https://baike.so.com/doc/2043774-2162626.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">丁香</a>。另有多个国家以康乃馨为国花：<a target=\"_blank\" href=\"https://baike.so.com/doc/1516725-1603545.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">摩洛哥</a>、<a target=\"_blank\" href=\"https://baike.so.com/doc/2362672-2498386.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">摩纳哥</a>、<a target=\"_blank\" href=\"https://baike.so.com/doc/1466348-1550399.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">捷克</a>、洪都拉斯、<a target=\"_blank\" href=\"https://baike.so.com/doc/1964095-2078493.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">土耳其</a>、西班牙<a class=\"reference_sup\" href=\"https://baike.so.com/doc/2744595-2896696.html#refff_2744595-2896696-1\" style=\"margin: 0px 0px 0px 2px; padding: 0px 2px; color: rgb(51, 102, 204); text-decoration-line: none; cursor: pointer; font-size: 12px; position: relative; top: -0.5em; vertical-align: baseline; white-space: nowrap;\">[1]</a>。</p><p><span style=\"font-size: 18px;\"><strong><span style=\"color: rgb(51, 51, 51); font-family: arial, sans-serif; text-indent: 28px; background-color: rgb(255, 255, 255);\"><img src=\"http://127.0.0.1:8080/../ueditor/jsp/upload/image/20190611/1560244930507073976.jpg\" title=\"1560244930507073976.jpg\" alt=\"t01c2b6c8f28215abab.jpg\"/></span></strong></span><br/></p><p><br/></p>', 'f56abe4d-470c-4958-83e9-ea83bb80574d', 'f28f1149-2327-4fe3-9066-542780643984', 'b406af58-2e84-45af-90ed-67faf7ce3496', 'c5c0b595-7255-4d0a-854a-3574f0d3ca69', '4e5ab942-4bc5-4ce9-9f2f-7d1fa00090c7', NULL, NULL, NULL, '5');
