INSERT INTO `xh_goods` VALUES ('690a6512ba824986977a191468b9cd2d', '1', '2019-04-19 15:58:59', '1', '2019-06-12 09:25:36', NULL, '0', '368d426edf6a42308e724d6065fdaf5f', '向日葵', 'XRK', '美满、团结、忠贞、永恒', '1', '1', '42', '82', '0', '<ul class=\"lemmaWgt-lemmaTitle lemmaWgt-lemmaTitle- list-paddingleft-2\" style=\"margin: 0px 0px 10px; padding: 0px; width: 700px; font-family: arial, tahoma, \"><li><p><span class=\"lemma-pinyin\" style=\"display: block; font-size: 14px;\"><span class=\"text\" style=\"color: rgb(145, 148, 145);\">[xiàng rì kuí]</span> <a class=\"speak\" title=\"点击发声\" style=\"color: rgb(19, 110, 194); position: relative; top: 1px; display: inline-block; outline: 0px; left: 2px; width: 16px; height: 16px; background: url(\"> </a></span></p><h1 style=\"margin: 0px 10px 0px 0px; padding: 0px; font-size: 34px; display: inline; line-height: 1.15; font-weight: 400; vertical-align: sub;\">向日葵</h1><p> </p><h2 style=\"margin: 0px 10px 0px -10px; padding: 0px; font-size: 20px; display: inline; font-weight: 400; vertical-align: sub;\">（菊科向日葵属植物）</h2></li></ul><p><br/></p><p>向日葵（拉丁文：<em>Helianthus</em> <em>annuus</em>L.），为<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%9C%A8%E5%85%B0%E7%BA%B2/8693562\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">木兰纲</a>、<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%8F%8A%E7%9B%AE\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">菊目</a>、菊科、向日葵属的一年生草本植物。高1～3.5米。茎直立，圆形多棱角，质硬被白色粗硬毛。广卵形的叶片通常互生，先端锐突或渐尖，有基出3脉，边缘具粗锯齿，两面粗糙，被毛，有长柄。<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E5%A4%B4%E7%8A%B6%E8%8A%B1%E5%BA%8F/801247\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">头状花序</a>，直径10～30厘米，单生于茎顶或枝端。</p><p>总苞片多层，叶质，覆瓦状排列，被长硬毛，夏季开花，花序边缘生中性的黄色舌状花，不结实。花序中部为两性管状花，棕色或紫色，能结实。矩卵形<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E7%98%A6%E6%9E%9C/1407632\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">瘦果</a>，果皮木质化，灰色或黑色，称<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%91%B5%E8%8A%B1%E7%B1%BD/588599\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">葵花籽</a>。<span class=\"sup--normal\" style=\"font-size: 12px; line-height: 0; position: relative; vertical-align: baseline; top: -0.5em; margin-left: 2px; color: rgb(51, 102, 204); cursor: pointer; padding: 0px 2px;\"> [1-2]</span><a class=\"sup-anchor\" style=\"color: rgb(19, 110, 194); position: relative; top: -50px; font-size: 0px; line-height: 0;\"> </a></p><p>原产南美洲，驯化种由<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%A5%BF%E7%8F%AD%E7%89%99/148941\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">西班牙</a>人于1510年从北美带到欧洲，最初为观赏用。19世纪末，又被从俄国引回北美洲。中国均有栽培。向日葵种子叫葵花籽，常炒制之后做为零食食用，味美，也可以榨<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%91%B5%E8%8A%B1%E7%B1%BD%E6%B2%B9/859823\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">葵花籽油</a>用于食用，油渣可以做饲料。</p><p><br/></p><p><span style=\"font-size: 22px;\">名称来历</span></p><p><a class=\"edit-icon j-edit-link\" style=\"color: rgb(136, 136, 136); display: block; float: right; height: 22px; line-height: 22px; padding-left: 24px; font-size: 12px; font-family: SimSun; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span class=\"cmn-icon wiki-lemma-icons wiki-lemma-icons_edit-lemma\" style=\"font-family: baikeFont_layout; -webkit-font-smoothing: antialiased; speak: none; font-variant-numeric: normal; font-variant-east-asian: normal; line-height: 1; outline: 0px; margin: 0px 3px 0px 0px; vertical-align: text-bottom; color: rgb(170, 170, 170);\"></span>编辑</a></p><p>向日葵又名朝阳花，因其花常朝着太阳而得名。英文名“sunflower”虽与其向日特性多少有些关联，名称主要还是来源于其金色花朵开放时酷似骄阳的形态，于16世纪至17世纪间从<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%8B%89%E4%B8%81%E8%AF%AD\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">拉丁语</a>中的太阳花——“flos solis”借译而来。向日葵的<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%B3%95%E8%AF%AD\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">法语</a>，<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E6%84%8F%E5%A4%A7%E5%88%A9%E8%AF%AD\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">意大利语</a>和<a target=\"_blank\" href=\"https://baike.baidu.com/item/%E8%A5%BF%E7%8F%AD%E7%89%99%E8%AF%AD/398390\" style=\"color: rgb(19, 110, 194); text-decoration-line: none;\">西班牙语</a>名称分别为“tournesol”，“girasol”和“girasol”，同汉语名称一样，也是基于“向日”这一特性来命名的。</p><p><br/></p><p><br/></p>', 'f537b1c6-4e0f-4a18-b229-e1698eaabc0f', '00306263-5878-478f-a179-be5cca48633f', 'ad19350f-7477-408b-a808-2732e3a9366f', '844ab5bd-4698-4891-add6-0592881277f4', '6fe210b7-59b9-4484-a11e-0d9e2b64e413', '00ecf131-e07b-4538-a8af-1e7b1abcd98e', '0', '300', '10');
INSERT INTO `xh_goods` VALUES ('6e04539fbd244c7b8b2c49352d43b109', '1', '2019-05-15 11:55:09', '1', '2019-06-11 16:03:43', NULL, '0', '368d426edf6a42308e724d6065fdaf5f', '扶郎', 'FL', '互敬互爱,不畏艰难.', '1', '1', '15.9', '20.9', '0', '<p class=\"article-info\" style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 26px; font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><strong><span style=\"font-family: sans-serif; font-size: 16px; color: rgb(34, 34, 34);\">扶郎菊</span></strong></p><p class=\"article-info\" style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 26px; font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: sans-serif; color: rgb(34, 34, 34); font-size: 14px;\">扶郎花（学名：Gerberajamesonii）属菊科多年生草本植物，全株具细毛，顶生花序，多数叶为基生，羽状浅裂。别名为非洲菊，太阳花等，繁殖用播种或分株法，原产地为南非。喜冬暖夏凉、空气流通、阳光充足的环境，不耐寒，忌炎热。喜肥沃疏松、排水良好、富含腐殖质的沙质壤土，忌粘重土壤，宜微酸性土壤，属半耐寒性花卉，可忍受短期的0℃低温。株高30～45cm，头状花序单生，高出叶面20～40cm，花径10～12cm，总苞盘状，钟形，舌状花瓣l～2或多轮呈重瓣状，花色有大红、橙红、淡红、黄色等。通常四季有花，以春秋两季最盛。</span></p><p class=\"article-info\" style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 26px; font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-family: sans-serif; color: rgb(34, 34, 34); font-size: 14px;\"><br/></span></p><p class=\"article-info\" style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 26px; font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px;\"><strong><span style=\"font-family: sans-serif; color: rgb(34, 34, 34);\">花语</span></strong></span></p><p class=\"article-info\" style=\"margin-top: 0px; margin-bottom: 0px; color: rgb(153, 153, 153); font-size: 14px; line-height: 26px; font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"font-size: 16px;\"><strong><span style=\"font-family: sans-serif; color: rgb(34, 34, 34);\"><span style=\"color: rgb(68, 68, 68); font-family: \"PingFang SC\", \"Hiragino Sans GB\", \"Microsoft YaHei\", \"WenQuanYi Micro Hei\", \"Helvetica Neue\", Arial, sans-serif; letter-spacing: 0.5px; background-color: rgb(255, 255, 255);\">象征神秘、互敬互爱，有毅力、不畏艰难</span></span></strong></span></p>', '79b468be-e484-4a42-9bef-f3df8c34057c', '6016d905-aff3-46f0-93c8-7a9f4748229a', '52be18f7-a1ac-49e5-98d4-795ad9115358', 'a5baa905-5e0d-4263-b8fe-016e838b4020', '57f2bd3f-f4e4-4164-a2de-57fc4d8e1b9e', NULL, NULL, NULL, '3');
