INSERT INTO `xh_goods` VALUES ('cc73dae2cfcf41d9913d55b923e6a1a3', '1', '2019-05-15 12:05:29', '1', '2019-06-11 15:53:07', NULL, '0', '368d426edf6a42308e724d6065fdaf5f', '玫瑰花', 'MGH', '爱意浓浓，深情满满', '1', '1', '19.9', '29.9', '0', '<p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong><span style=\"font-size: 16px;\">玫瑰花</span></strong>--<span style=\"color: rgb(119, 119, 119); font-family: \">蔷薇科蔷薇属植物</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">玫瑰<em style=\"margin: 0px; padding: 0px;\">（学名：Rosa rugosa）</em>是<a target=\"_blank\" href=\"https://baike.so.com/doc/6073924-6287000.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">蔷薇科</a>蔷薇属植物，在日常生活中是蔷薇属一系列花大艳丽的栽培品种的统称。玫瑰原产是中国。在古时的汉语，“玫瑰”一词原意是指红色美玉。长久以来，玫瑰就象征着美丽和爱情。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">玫瑰属落叶灌木，枝杆多针刺，奇数羽状复叶，小叶5-9片，椭圆形，有边刺。花瓣倒卵形，重瓣至半重瓣，花有紫红色、白色，果期8-9月，扁球形。枝条较为柔弱软垂且多密刺，每年花期只有一次，因此较少用于育种，近来其主要被重视的特性为抗病性与耐寒性。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><span style=\"text-indent: 2em;\">玫瑰原产我国华北以及日本和朝鲜。我国各地均有栽培。</span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong><span style=\"text-indent: 2em; font-size: 16px;\">形态特征</span></strong><span style=\"text-indent: 2em; font-size: 16px;\"><br/></span></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><br/></p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">直立<a target=\"_blank\" href=\"https://baike.so.com/doc/3837721-4029782.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">灌木</a>，高可达2米；茎粗壮，丛生；小枝密被绒毛，并有针刺和<a target=\"_blank\" href=\"https://baike.so.com/doc/983124-1039256.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">腺毛</a>，有直立或弯曲、淡黄色的<a target=\"_blank\" href=\"https://baike.so.com/doc/603557-638972.html\" style=\"margin: 0px; padding: 0px; color: rgb(19, 110, 194); text-decoration-line: none;\">皮刺</a>，皮刺外被绒毛。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">小叶5-9，连叶柄长5-13厘米；小叶片椭圆形或椭圆状倒卵形，长1.5-4.5厘米，宽1-2.5厘米，先端急尖或圆钝，基部圆形或宽楔形，边缘有尖锐锯齿，上面深绿色，无毛，叶脉下陷，有褶皱，下面灰绿色，中脉突起，网脉明显，密被绒毛和腺毛，有时腺毛不明显；叶柄和叶轴密被绒毛和腺毛；托叶大部贴生于叶柄，离生部分卵形，边缘有带腺锯齿，下面被绒毛。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">花单生于叶腋，或数朵簇生，苞片卵形，边缘有腺毛，外被绒毛；花梗长5 -22 5毫米，密被绒毛和腺毛；花直径4-5.5厘米；萼片卵状披针形，先端尾状渐尖，常有羽状裂片而扩展成叶状，上面有稀疏柔毛，下面密被柔毛和腺毛；花瓣倒卵形，重瓣至半重瓣，芳香，紫红色至白色；花柱离生，被毛，稍伸出萼筒口外，比雄蕊短很多。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; color: rgb(51, 51, 51); line-height: 24px; text-indent: 2em; zoom: 1; font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\">果扁球形，直径2-2.5厘米，砖红色，肉质，平滑，萼片宿存。花期5-6月，果期8-9月。</p><p style=\"margin-top: 0px; margin-bottom: 15px; padding: 0px; line-height: 24px; text-indent: 2em; color: rgb(51, 51, 51); font-family: arial, sans-serif; font-size: 14px; white-space: normal; background-color: rgb(255, 255, 255);\"><strong><span style=\"text-indent: 2em; font-size: 16px;\"><img src=\"http://127.0.0.1:8080/../ueditor/jsp/upload/image/20190611/1560239504026045078.jpg\" title=\"1560239504026045078.jpg\" alt=\"1133.jpg\"/></span></strong><br/></p><p><br/></p>', '0d3f24e5-2307-4736-b979-ee7c5eefbe7c', '41343e7e-f4dd-4c0c-8b9f-02b3d23bc5d6', '374908bc-c13f-4b27-bd39-430c93ffc454', '89a2108b-d16c-4134-8b89-face28145184', 'b128d883-7bc7-4606-99b6-63b0465a9c96', NULL, NULL, NULL, '5');
